@base <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

<System:ATM> rdf:type owl:Class .
<Flow:message> rdf:type owl:Class .
<Item:transaction> rdf:type owl:Class .
<StateValue:succeeded> rdf:type owl:Class .
<System:bank_computer> rdf:type owl:Class .
<Function:dispense> rdf:type owl:Class .
<Item:money> rdf:type owl:Class .

<System:ATM> rdfs:subClassOf [
  rdf:type owl:Restriction ;
  owl:onProperty <Flow:message> ;
  owl:someValuesFrom [
    rdf:type owl:Restriction ;
    owl:onProperty <Item:transaction> ;
    owl:hasValue <StateValue:succeeded>
  ]
] .

<System:ATM> rdfs:subClassOf [
  rdf:type owl:Restriction ;
  owl:onProperty <Function:dispense> ;
  owl:someValuesFrom <Item:money>
] .
